import React from "react";
import "./App.css";
import Menu from "./components/Menu/Menu";

function App() {
  return (
    <div className="App">
      <Menu />
      <section id="home">Home Content</section>
      <section id="benefits">Key Benefits Content</section>
      <section id="impact">Air Pollution Impact Content</section>
      <section id="approach">Assessment Approach Content</section>
      <section id="nasa">NASA/TEMPO Program Content</section>
      <section id="api">API Capabilities Content</section>
      <section id="customers">For Customers Content</section>
      <section id="contacts">Contacts Content</section>
    </div>
  );
}

export default App;
